import React, { useState } from 'react';
import './Register.css'; // Import your CSS file for styling

const Register = ({ toggleForm }) => {
  const [step, setStep] = useState(1);
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [verificationCode, setVerificationCode] = useState('');

  const handleSignUp = (e) => {
    e.preventDefault();
    // Simulate a transition to the next step
    setStep(2);
  };

  const handleVerification = async (e) => {
    e.preventDefault();
    // Add your verification logic here
    console.log('Verification code:', verificationCode);
    console.log('Passwords:', password, confirmPassword);
  };

  return (
    <div className="container">
      <div className="register-container">
        {/* Step 1: Register Form */}
        {step === 1 && (
          <div className="info">
            <form className="register-form" onSubmit={handleSignUp}>
              <span className="heading"><h1>Sign Up</h1></span>
              <div className="validate-input">
                <input
                  className="input"
                  type="text"
                  placeholder="Name"
                  value={name}
                  onChange={(e) => setName(e.target.value)}
                  required
                />
                <i className="fa fa-user"></i>
              </div>
              <div className="validate-input">
                <input
                  className="input"
                  type="email"
                  placeholder="Email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  required
                />
                <i className="fa fa-envelope"></i>
              </div>
              <div className="validate-input">
                <input
                  className="input"
                  type="tel"
                  placeholder="Phone"
                  value={phone}
                  onChange={(e) => setPhone(e.target.value)}
                  required
                />
                <i className="fa fa-phone"></i>
              </div>
              <div className="register-btn">
                <button className="btn" type="submit">Sign Up</button>
              </div>
            </form>
          </div>
        )}

        {/* Step 2: Password & Verification Form */}
        {step === 2 && (
          <div className="info">
            <form className="register-form" onSubmit={handleVerification}>
              <span className="heading"><h1>Set Your Password</h1></span>
              <div className="validate-input">
                <input
                  className="input"
                  type="password"
                  placeholder="New Password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  required
                />
                <i className="fa fa-lock"></i>
              </div>
              <div className="validate-input">
                <input
                  className="input"
                  type="password"
                  placeholder="Re-enter Password"
                  value={confirmPassword}
                  onChange={(e) => setConfirmPassword(e.target.value)}
                  required
                />
                <i className="fa fa-lock"></i>
              </div>
              <div className="validate-input">
                <input
                  className="input"
                  type="text"
                  placeholder="Verification Code"
                  value={verificationCode}
                  onChange={(e) => setVerificationCode(e.target.value)}
                  required
                />
                <i className="fa fa-check-circle"></i>
              </div>
              <div className="register-btn">
                <button className="btn" type="submit">Verify & Register</button>
              </div>
            </form>
          </div>
        )}
      </div>
    </div>
  );
}

export default Register;
